import React, { useState } from 'react';
import Particles from 'react-particles-js';
import Clarifai from 'clarifai'
import Navigation from './components/Navigation/Navigation';
import Logo from './components/Logo/Logo';
import ImageLinkForm from './components/ImageLInkForm/ImageLinkForm';
import FaceRecognition from './components/FaceRecognition/FaceRecognition';
import Rank from './components/Rank/Rank';
import './App.css';

const app = new Clarifai.App({
  apiKey: 'e74294ae3ed9404aa79eb241c1844971'
 });

const particlesOptions = {
  particles: {
    number: {
      value: 60,
      density: {
        enable: true,
        value_area: 600
      }
    }
  }
}



function App() {
 const initialValues  = {
  input:"",
  imageUrl:""
}



 const [input, setInput] = useState(initialValues)


const onInputChange = (e) => {
  console.log(e.target.value);
  // setState({input: event.target.value});
}

const onButtonSubmit =() => {
setInput({imageUrl})
  app.models
  .predict(

    // .predict(Clarifai.FACE_DETECT_MODEL, this.state.input)
    // to:
    // .predict('c0c0ac362b03416da06ab3fa36fb58e3', this.state.input)
      Clarifai.FACE_DETECT_MODEL,
      'https://images.unsplash.com/photo-1507003211169-0a1dd7228f2d?ixid=MnwxMjA3fDB8MHxzZWFyY2h8MXx8ZmFjZXxlbnwwfHwwfHw%3D&ixlib=rb-1.2.1&auto=format&fit=crop&w=900&q=60')
    .then(function(res) { console.log(res)},
    function(err) {console.log(err)}
    )
}



  return (
    <div className="App">
       <Particles className="particles" 
       params={particlesOptions }
       />
      <Navigation />
      <Logo />
      <Rank />
      <ImageLinkForm  
        onInputChange={onInputChange} 
        onButtonSubmit={onButtonSubmit}/>
      {<FaceRecognition />}
    </div>
  );
}

export default App;
